import React from 'react'
import Card from '@material-ui/core/Card'
import CardActionArea from '@material-ui/core/CardActionArea'
import CardActions from '@material-ui/core/CardActions'
import CardContent from '@material-ui/core/CardContent'
import CardMedia from '@material-ui/core/CardMedia'
import Button from '@material-ui/core/Button'
import Typography from '@material-ui/core/Typography'
import { makeStyles } from '@material-ui/core/styles';
import PropTypes from 'prop-types';


const useStyles = makeStyles({
    card: {
      
      maxWidth: 345,
    },
    media: {
      height: 160,
    },
  });
  

export default function Articulo(props) {
    const classes = useStyles();
    const {id,titulo,descripcion,image}=this.props.articulo;
    return (
        <React.Fragment>
            <Card className={classes.card}>
            <CardActionArea>
                <CardMedia
                className={classes.media}
                image={this.props.articulo.image}
                title={this.props.articulo.titulo}
                />
                <CardContent>
                <Typography gutterBottom variant="h5" component="h2">
                    {this.props.articulo.titulo}
                </Typography>
                <Typography variant="body2" color="textSecondary" component="p">
                    {this.props.articulo.descripcion}
                </Typography>
                </CardContent>
            </CardActionArea>
            <CardActions>
                <Button size="small" color="primary">
                Compartir
                </Button>
                <Button size="small" color="primary">
                Ver
                </Button>
            </CardActions>
            </Card>
        </React.Fragment>
    )
}

//Proptypes
Articulo.propTypes= {
    articulo: PropTypes.object.isRequired,
    ver: PropTypes.func.isRequired
}
